import { useState } from "react"

const [HistoryArray, setHistoryArray] = useState(Array(0));

export default function GameHistory() {
    return (
        <ol>
            {
                Array(HistoryArray.length).fill(null).map(
                    (_,i) => (
                        <li key={i}>game {i} </li>
                    )
                )
            }
        </ol>
    )
}

export function updateHistory(boardArray, player) {
    let newArray = HistoryArray.slice();
    setHistoryArray(newArray.push(
        {
            'player': player,
            'board': boardArray
        }
    ));
}
